import React, { useState } from 'react';
import {
  Box,
  IconButton,
  Chip,
  Tooltip,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';
import PageHeader from '../../components/common/PageHeader';
import DataTable from '../../components/common/DataTable';

const Leads = () => {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(false);

  const columns = [
    { id: 'name', label: 'Name' },
    { id: 'company', label: 'Company' },
    { id: 'email', label: 'Email' },
    { id: 'phone', label: 'Phone' },
    {
      id: 'status',
      label: 'Status',
      render: (value) => (
        <Chip
          label={value}
          color={
            value === 'Hot' ? 'error' :
            value === 'Warm' ? 'warning' : 'default'
          }
          size="small"
        />
      )
    },
    {
      id: 'actions',
      label: 'Actions',
      render: (_, lead) => (
        <Box sx={{ display: 'flex', gap: 1 }}>
          <Tooltip title="Edit">
            <IconButton size="small">
              <EditIcon />
            </IconButton>
          </Tooltip>
          <Tooltip title="Delete">
            <IconButton size="small" color="error">
              <DeleteIcon />
            </IconButton>
          </Tooltip>
        </Box>
      ),
    },
  ];

  return (
    <Box sx={{ p: 3 }}>
      <PageHeader
        title="Leads"
        action={true}
        actionText="Add Lead"
        actionIcon={<AddIcon />}
        onActionClick={() => {}}
      />
      <DataTable
        columns={columns}
        data={leads}
        loading={loading}
      />
    </Box>
  );
};

export default Leads;
